import React, { useEffect, useState } from "react";
import TextFieldStyled from "@material-ui/core/TextField";
import useForm from "../../hooks/useForm";
import back from "../../assets/back.svg";
import { useNavigate } from "react-router-dom";
import { Title, Container, RegisteredProfile, EditContainer, SaveEditProfile } from './styled';
import { handleProfile } from "../../axiosRequests/user";

const EditAddress = () => {
  const navigate= useNavigate();
  const [form, onChange, clear] = useForm({ neighbourhood: "", number: "", city: "", apartment: "", state: "", street: "" });

  const handleSubmission = (event) => {
    event.preventDefault();
    handleProfile(form, clear, navigate);
    // props.setPage(false)
  };

  const goBack = () => {
    navigate("/perfil");
  };

  return (
    <>
      <img src={back} onClick={goBack} />

      <Title>
      <h1>Editar Endereço</h1>
      </Title>

      <TextFieldStyled
        onSubmit={handleSubmission}
        name="logradouro"
        value={form.street}
        onChange={onChange}
        variant="outlined"
        label="Logradouro"
        required
      />
      <TextFieldStyled
        name="numero"
        value={form.number}
        onChange={onChange}
        variant="outlined"
        label="Número"
        required
      />
      <TextFieldStyled
        name="complemento"
        value={form.cpf}
        onChange={onChange}
        variant="outlined"
        label="Complemento"
        placeholder="Somente números"
        required
      />
        <TextFieldStyled
        name="bairro"
        value={form.neighbourhood}
        onChange={onChange}
        variant="outlined"
        label="Bairro"
        required
        />
        <TextFieldStyled
        name="cidade"
        value={form.city}
        onChange={onChange}
        variant="outlined"
        label="Cidade"
        required
        />
        <TextFieldStyled
        name="estado"
        value={form.state}
        onChange={onChange}
        variant="outlined"
        label="Estado"
        required
        />
      <SaveEditProfile
      onClick={handleSubmission}>SALVAR
      </SaveEditProfile>
    </>
  );
};

export default EditAddress;
